def square_root(n):
    if n == 0 and n == 1:
        return n
    start = 1
    end = n
    while start <= end:
        mid = (start + end) // 2
        if mid * mid == n:
            return mid
        if mid * mid < n:
            start = mid + 1
            result = mid
        else:
            end = mid - 1
    return result

